import React from "react";
import { NavLink } from "react-router-dom";
import zymhomeproimg from "../image/zymhomeproimg.jpg"
const Homepro = () =>{
    return(
        <>
         <Commancomppro
         name="welcome in about page"
         imgsrc={aboutprozym}
         visit="/service"
         btname="Get Started"
        />
        </>


    );
};
export default Homepro;
